import React, { Component } from 'react'
import '../App.css'
import { motion } from "framer-motion"

export class HomePage extends Component {

    render() {
        const container = {
            hidden: { opacity: 0 },
            show: {
              opacity: 1,
              transition: {
                staggerChildren: 0.5
              }
            }
          }

          const item = {
            hidden: { opacity: 0 },
            show: { opacity: 1 }
          }
        return (
            <div className="homeInfoCard">
                <motion.ul variants={container} initial="hidden" animate="visible" className="home-page-info">
                        <motion.li style={{fontSize: "6vh"}}>Andrew Zajac</motion.li>
                        <motion.li style={{fontSize: "3vh"}}>Software Engineer</motion.li>
                </motion.ul>


            </div>
        )
    }
}

export default HomePage
